class Querier extends Component {
  constructor(props) {
    super();
    this.state = {
      location: '请在上方选择您所在的城市',
      src: './img/weather.jpg',
      now: {},
      load: 1,
      list: [{
        text: '湿度:__%'
      }, {
        text: '气压：__hPa'
      }, {
        text: '能见度：__km'
      }]
    };
  }

  loadResource() {
    // 利用var被提升的特性，为了美观将list写在本文件最末尾
    if (this.state.load != 1) return;
    var x = document.getElementById("mySelect");

    for (var i = 0; i < list.length; i++) {
      var option = document.createElement("option");
      option.innerHTML = list[i];
      x.appendChild(option);
    }

    this.state.load++;
  }

  getLocationId() {
    // console.log(e.value)
    var id = document.getElementById("mySelect").value.split(' '); // console.log(id[id.length-1])

    this.setState({
      location: id[0]
    });
    return id[id.length - 1];
  }

  getWeather(id) {
    let script = `onmessage=function(e){
  var id=e.data
  if(e.data=='RECEIVE')
      close()

  getHq(id);
  }

  function getHq(id)
  {
    var ajax=new XMLHttpRequest()
    ajax.open('GET','https://devapi.qweather.com/v7/weather/now?key=647bab7e451440af8e4d07ffc84125d0&location='+id);
    ajax.send()
    ajax.onreadystatechange=function()
    {
        if(ajax.readyState==4 && ajax.status==200)
        {
            var json=JSON.parse( ajax.responseText)
            // console.log(json.now)

            postMessage(json.now)
        }
    }
  }  `;
    let workerBlob = new Blob([script], {
      type: "text/javascript"
    });
    let url = URL.createObjectURL(workerBlob);
    let worker = new Worker(url);
    worker.postMessage(id);
    var that = this;

    worker.onmessage = function (e) {
      if (e.data != 'OVER') {
        console.log('收到了', e.data);
        that.state.now = e.data;
        var listNow = [];
        listNow[0] = {
          text: '湿度:' + that.state.now.humidity + '%'
        };
        listNow[1] = {
          text: '气压：' + that.state.now.pressure + 'hPa'
        };
        listNow[2] = {
          text: '能见度：' + that.state.now.vis + 'km'
        }; // listNow[3] = { text: '风向:' + that.state.now.windDir + '' }
        // listNow[4] = { text: '风速:' + that.state.now.windSpeed + 'Km/h' }
        // listNow[5] = { text: '风力:' + that.state.now.windScale + '级' }

        that.setState({
          list: listNow,
          load: 1
        });

        if (that.state.now.text.match('晴')) {
          document.getElementById('query').style.backgroundImage = "url(./img/qing.jpg)";
        } else if (that.state.now.text.match('云') || that.state.now.text.match('阴')) {
          document.getElementById('query').style.backgroundImage = "url(./img/yin.jpg)";
        } else {
          document.getElementById('query').style.backgroundImage = "url(./img/yu.jpg)";
        }

        this.postMessage('RECEIVE');
      }
    };
  }

  render() {
    return createElement("div", {
      id: "query",
      style: " text-align:center; weight:360px; height:640px; font-family: Georgia; background-image:url('./img/qing.jpg')"
    }, createElement("ul", {
      className: "location"
    }, createElement(Select, {
      style: {
        color: '#FFF',
        fontStyle: 'italic',
        textShadow: '3px 6px rgba(0, 0, 0, 0.25)'
      },
      onClick: () => {
        this.loadResource();
      },
      onChange: () => {
        let id = this.getLocationId();
        this.getWeather(id);
      }
    }), createElement("br", null), createElement("br", null), createElement(Item, {
      style: {
        color: '#FFF',
        fontStyle: 'italic',
        textShawow: '3px 6px rgba(0, 0, 0, 0.25)'
      }
    }, this.state.location), createElement("div", {
      class: "weather-box",
      style: " text-align: center;"
    }, createElement("div", {
      class: "temp"
    }, createElement(Item, {
      style: {
        display: 'inline-block',
        padding: '10px 25px',
        fontSize: '102px',
        fontWeight: '900',
        textShawow: '3px 6px rgba(0, 0, 0, 0.25)',
        backgroundColor: 'rgba(255, 255, 255, 0.25)',
        borderRadius: '16px',
        margin: '30px 0px',
        boxShadow: '3px 6px rgba(0, 0, 0, 0.25)',
        color: 'white'
      }
    }, this.state.now.temp ? this.state.now.temp : '__', "\xB0C")), createElement("div", {
      class: "weather"
    }, createElement(Item, {
      style: {
        color: '#FFF',
        fontSize: '48px',
        fontStyle: 'italic',
        textShawow: '3px 6px rgba(0, 0, 0, 0.25)'
      }
    }, this.state.now.text ? this.state.now.text : ' ')))), createElement("ul", {
      className: "list"
    }, this.state.list.map((item, index) => {
      return createElement("div", {
        class: "weather"
      }, createElement(Item, {
        style: {
          color: '#FFF',
          fontStyle: 'italic',
          textShawow: '3px 6px rgba(0, 0, 0, 0.25)'
        }
      }, item.text, createElement("br", null), createElement("br", null), createElement("br", null)));
    })));
  }

}

